import React, { Component } from "react";
import './App.css';

class TimerWindow extends Component { 
  render() {
   return (
    <div className='column'>
      <div className="col-md-6 col-sm-10 mx-auto p-0">
        <div className="card p-3">
          Hello
        </div>
        <div className="card p-3">
          Hello
        </div>
      </div>
    </div> 
    ); }
  }

function onPress() {
  alert("You clicked me!");
}

function App() {
  return (
    <div>
      <main className="container">
        <div className='header-box'>
          <h1 className="text-Black text-uppercase text-center my-4">BAKE BUDDY</h1>
        </div>
        <div className='row'>
          <div className='column'>
            <div className="col-md-6 col-sm-10 mx-auto p-0">
              <div className="card p-3">
                <button onClick={onPress}>Ciabatta</button>
                <button onClick={onPress}>Baguette</button>
                <button onClick={onPress}>Sourdough</button>
              </div>
            </div>
          </div>
          <div className='column'>
            <div className="col-md-6 col-sm-10 mx-auto p-0">
              <TimerWindow />
            </div>
          </div>
        </div>
      </main>
    </div>
  );
}

export default App;
